import { FaBell, FaBars } from 'react-icons/fa';

export default function MobileNavbar() {
  return (
    <nav className="bg-white px-4 py-3 flex justify-between items-center shadow-sm md:hidden fixed top-0 left-0 right-0 z-50">
      {/* Menu burger à gauche */}
      <button className="p-1">
        <FaBars className="text-2xl text-gray-700" />
      </button>

      {/* Groupe notifications + profil à droite */}
      <div className="flex items-center space-x-3">
        {/* Bouton notification avec badge */}
        <button className="relative p-1">
          <div className="w-9 h-9 rounded-full bg-gray-100 flex items-center justify-center shadow-sm">
            <FaBell className="text-lg text-gray-600" />
          </div>
          <span className="absolute top-0 right-0 w-2 h-2 bg-blue-500 rounded-full"></span>
        </button>

        {/* Avatar profil */}
        <button className="p-1">
          <div className="w-9 h-9 rounded-full bg-gray-100 shadow-sm overflow-hidden">
            <img
              src="https://randomuser.me/api/portraits/women/44.jpg"
              alt="Profil utilisateur"
              className="w-full h-full object-cover"
            />
          </div>
        </button>
      </div>
    </nav>
  );
}
